    def minWindow(self, s: str, t: str) -> str:
        tdict = collections.Counter(t)
        minLength = float('inf')
        minChrs = ''
        tleft = len(t)
        l = 0
        for i in range(l, len(s)):
            chr = s[i]
            if tdict[chr] > 0:
                tleft -= 1
            tdict[chr] -= 1
            while l < len(s) and tdict[s[l]] < 0:
                tdict[s[l]] += 1
                l += 1
            if tleft == 0 and i - l < minLength:
                minLength = i - l
                minChrs = s[l:i + 1]

        return minChrs


